INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (2834, "ペコリーヌとの出会い", 20063115, 2, 0, 1, 7, 91002, 40, 10118, 8, 5118061, "フリーマーケット会場", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "青空の下で謁見");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (2835, "マホとの出会い", 20063115, 2, 0, 1, 7, 91002, 40, 10118, 8, 5118062, "フリーマーケット会場", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "未来の騎空団\nマスコット？");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (2837, "アキノとの出会い", 20063115, 2, 0, 1, 7, 91002, 40, 10118, 8, 5118063, "ランドソル市街地", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "お嬢さまからの\n緊急依頼");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (4108402, "ジュンとの出会い", 20063115, 2, 0, 1, 18, 91002, 40, 10118, 8, 5118064, "フリーマーケット会場", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "黄金色の悩みごと");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (4107402, "カオリとの出会い", 20063115, 2, 0, 1, 18, 91002, 40, 10118, 8, 5118065, "フリーマーケット会場", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "白熱！　格闘大会！");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (9000227, "ニノンとの出会い", 20063115, 2, 1, 1, 16, 91002, 40, 10118, 8, 5118066, "オーエド町", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "祭り太鼓はオーエドの華");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (2101181, "スズナとの出会い", 20063115, 3, 0, 1, 19, 91002, 40, 10118, 8, 5118067, "フリーマーケット会場", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "人気者は遅れて\nやってくる");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (4109402, "ナナカとの出会い", 20063115, 3, 0, 1, 18, 91002, 40, 10118, 8, 5118068, "ランドソル市街地", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "巫女・ミーツ・魔法少女");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (4305402, "キャル＆コッコロとの出会い", 20063115, 3, 0, 1, 18, 91002, 40, 10118, 8, 5118069, "フリーマーケット会場", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "ネズ耳は二度なくなる");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (4101402, "ユカリとの出会い", 20063115, 3, 0, 1, 18, 91002, 40, 10118, 8, 5118070, "ランドソル市街地", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "この出会いにカンパイ！");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (4106402, "アオイとの出会い", 20063115, 3, 0, 1, 18, 91002, 40, 10118, 8, 5118071, "ランドソル市街地", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "陰陽アンサンブル");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (2836, "シノブとの出会い", 20063115, 3, 1, 1, 7, 91002, 40, 10118, 8, 5118072, "フリーマーケット会場", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "運試し十番勝負！");
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (0, "オープニング", 20063115, 1, 0, 0, 0, 0, 0, 10118, 0, 5118600, 0, 0, "彼女たちの新たな日常");
